import React, { Component } from 'react';

class App extends Component{
  showInfoObj1(obj1){
    if(obj1.status){
      return <h3>
      ID: {obj1.id} <br/>
      Name:{obj1.name}<br/>
      Age: {obj1.age}<br/>
      status: {obj1.status ? 'active' : 'denning'}
    </h3>
    }
  }
  render() {
    let a='About';
    var obj1={
      id:1,
      name: 'son',
      age: 18,
      status: false
    };

    return (
      <div>
            <nav className="navbar navbar-inverse">
            <a className="navbar-brand" >Title</a>
            <ul className="nav navbar-nav">
              <li className="active">
                <a >Home</a>
              </li>
              <li>
                <a >{a}</a>
              </li>
            </ul>
          </nav>
          { this.showInfoObj1(obj1)}
      </div>
    );
  };
};

export default App;
